import web from './Images/home.png'
import comp from './Images/3.jpg'
import wr from './Images/wr.jpeg'


const Sdata = [
    {
        imgsrc : web,
        title : 'Web Development',

    },
    {
        imgsrc : comp,
        title : 'Soft Development',
        
    },
    {
        imgsrc : web,
        title : 'Web Development',
        
    },
    {
        imgsrc : wr,
        title : 'Web Designin',
        
    },
    {
        imgsrc : comp,
        title : 'software Development',
        
    },
    {
        imgsrc : wr,
        title : 'Web Development',
        
    }

]
export default Sdata
